import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import './Classroom.css';
import menu from '../Sections/menu.png';
import user from '../Sections/user.png';
import house from '../Sections/house.png';
import book from '../Sections/book.png';
import settings from '../Sections/technical-support.png';
import teachings from '../Sections/teachings.png';
import document from '../Sections/document.png';
import planning from '../Sections/planning.png';

export const Classroom = () => {
  return (
    <div style={{ display: 'flex' }}>
      <div className='classroom-sidebar'>
        <div className="sidebar-item">
            <img src={menu} alt="" />
            <h1>E</h1> 
        </div> 
        <div className='sidebar-item'>
          <img src={house} alt="" />
          <Link to="home">Home</Link>
        </div>
        <div className='sidebar-item'>
          <img src={user} alt="" />
          <Link to="profile">Profile</Link>
        </div>
        <div className='sidebar-item'>
          <img src={book} alt="" />
          <Link to="modules">Modules</Link>
        </div>
        <div className='sidebar-item'>
          <img src={teachings} alt="" />
          <Link to="courses">Courses</Link>
        </div>
        <div className='sidebar-item'>
          <img src={document} alt="" />
          <Link to="grades">Grades</Link>
        </div>
        <div className='sidebar-item'>
          <img src={planning} alt="" />
          <Link to="tasks">Tasks</Link>
        </div>
        <div className='sidebar-item'>
          <img src={settings} alt="" />
          <Link to="settings">Settings</Link>
        </div>
      </div>

      <div style={{ flex: 1, padding: '20px' }}>
        <Outlet />
      </div>
    </div>
  );
};
